import React from "react";
import { Map, Placemark } from "react-2gis-maps";

const Google = () => {
  return (
    <Map center={[55.751244, 37.618423]} zoom={10} style={{ width: "100%", height: "400px" }}>
      <Placemark geometry={[55.751244, 37.618423]} properties={{ balloonContent: "Moscow" }} />
    </Map>
  );
};

export default Google;
